import React from 'react';
import { Container, Box, Grid } from '@material-ui/core';

const Footer = () => {
  return (
    <footer>
      <Box>
        <Container maxWidth="lg">
          <Grid container spacing={5}></Grid>
        </Container>
      </Box>
    </footer>
  );
};
export default Footer;
